import React from 'react';
import Navbar from './components/Navbar';
import Sidebar from './components/Sidebar';


const Dashboard = () => {
  return (
    <div className="dashboard-layout" style={{ display: 'flex' }}>
      {/* Sidebar */}
      <Sidebar />

      {/* Main content area */}
      <div style={{ flex: 1 }}>
        {/* Navbar */}
        <Navbar />

        {/* Dashboard Content */}
        <div style={{ padding: '20px' }}>
          <h1>Energy Savings Tips</h1>
          <div className="tips-grid">
            <div className="tip-card">Use LED Bulbs</div>
            <div className="tip-card">Unplug Devices</div>
            <div className="tip-card">Seal Windows</div>
            <div className="tip-card">Use Smart Thermostat</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
